import{_ as t,c as e,o as l,a5 as a}from"./chunks/framework.Dnp7cN4M.js";const b=JSON.parse('{"title":"html api","description":"","frontmatter":{},"headers":[],"relativePath":"views/Basics/Html/api.md","filePath":"views/Basics/Html/api.md","lastUpdated":1723892378000}'),r={name:"views/Basics/Html/api.md"},d=a('<h1 id="html-api" tabindex="-1">html api <a class="header-anchor" href="#html-api" aria-label="Permalink to &quot;html api&quot;">​</a></h1><h2 id="a-锚点元素" tabindex="-1"><code>&lt;a&gt;</code>:锚点元素 <a class="header-anchor" href="#a-锚点元素" aria-label="Permalink to &quot;`&lt;a&gt;`:锚点元素&quot;">​</a></h2><blockquote><p><code>可以通过 href 属性创建通向其他网页，文件，电子邮件的链接。 &lt;a&gt; 中如果存在 href 属性 当它聚焦时按下回车键会触发</code></p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">download</td><td style="text-align:center;"><code> 导致浏览器将链接的 URL 视为下载资源。 filename：决定文件名的值。/ 和 \\ 被转化为下划线（_）。&lt;br/&gt;文件系统可能会阻止文件名中其他的字符，因此浏览器会在必要时适当调整文件名。</code></td></tr><tr><td style="text-align:center;">href</td><td style="text-align:center;">超链接所指向的 URL。链接不限于基于 HTTP 的 URL——它们可以使用浏览器支持的任何 URL 协议：</td></tr><tr><td style="text-align:center;">hreflang</td><td style="text-align:center;">该属性用于指定所链接到的文档的人类语言。其仅提供建议，并没有内置的功能。其允许的值与全局的 lang 属性一致。</td></tr><tr><td style="text-align:center;">ping</td><td style="text-align:center;">包含一个以空格分隔的 URL 列表，当跟随超链接时，浏览器会发送带有正文 PING 的 POST 请求。通常用于跟踪</td></tr><tr><td style="text-align:center;">referrerpolicy</td><td style="text-align:center;">在跟随链接时，referrer 需要发送多少内容：</td></tr><tr><td style="text-align:center;">rel</td><td style="text-align:center;">指定当前文档与目标文档之间的关系。</td></tr><tr><td style="text-align:center;">target</td><td style="text-align:center;">指定在何处打开链接。_self：当前页面加载。（默认）_blank：通常在新标签页打开，但用户可以通过配置选择在新窗口打开。_parent：当前浏览环境的父级浏览上下文。如果没有父级框架，行为与 _self 相同。_top：最顶级的浏览上下文（当前浏览上下文中最“高”的祖先）。如果没有祖先，行为与 _self 相同</td></tr></tbody></table><h2 id="audio-元素用于在文档中嵌入音频内容" tabindex="-1"><code>&lt;audio&gt;</code>元素用于在文档中嵌入音频内容 <a class="header-anchor" href="#audio-元素用于在文档中嵌入音频内容" aria-label="Permalink to &quot;`&lt;audio&gt;`元素用于在文档中嵌入音频内容&quot;">​</a></h2><blockquote><p>audio <code>元素可以包含一个或多个音频资源，这些音频资源可以使用 src 属性或者 &lt;source&gt; 元素来进行描述：浏览器将会选择最合适的一个来使用。也可以使用 MediaStream 将这个元素用于流式媒体</code></p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">autoplay</td><td style="text-align:center;">如果设置，浏览器将会在页面加载后立即开始播放音频。</td></tr><tr><td style="text-align:center;">controls</td><td style="text-align:center;">如果设置，浏览器将会在页面加载后立即显示音频控件。</td></tr><tr><td style="text-align:center;">loop</td><td style="text-align:center;">如果设置，浏览器将会在播放完音频后重新开始播放。</td></tr><tr><td style="text-align:center;">muted</td><td style="text-align:center;">如果设置，浏览器将会在页面加载后立即静音音频。</td></tr><tr><td style="text-align:center;">crossorign</td><td style="text-align:center;">设置音频的跨域属性。</td></tr><tr><td style="text-align:center;">preload</td><td style="text-align:center;">设置音频的预加载属性。</td></tr><tr><td style="text-align:center;">src</td><td style="text-align:center;">设置音频的源文件。</td></tr><tr><td style="text-align:center;"><code>&lt;source&gt;</code></td><td style="text-align:center;"><code>&lt;source&gt; 元素用于指定一个音频资源，浏览器将会选择最合适的一个来使用。</code></td></tr><tr><td style="text-align:center;">currentTime</td><td style="text-align:center;">设置或返回音频的当前播放位置。</td></tr><tr><td style="text-align:center;">duration</td><td style="text-align:center;">设置或返回音频的总时长。</td></tr><tr><td style="text-align:center;">ended</td><td style="text-align:center;">设置或返回音频是否已结束。</td></tr><tr><td style="text-align:center;">muted</td><td style="text-align:center;">设置或返回音频是否静音。</td></tr></tbody></table><h5>事件</h5><table tabindex="0"><thead><tr><th style="text-align:center;">事件</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">onabort</td><td style="text-align:center;">当音频加载被中断时触发。</td></tr><tr><td style="text-align:center;">oncanplay</td><td style="text-align:center;">当浏览器准备好播放音频时触发。</td></tr><tr><td style="text-align:center;">oncanplaythrough</td><td style="text-align:center;">当浏览器准备好播放音频时触发。</td></tr><tr><td style="text-align:center;">durationchange</td><td style="text-align:center;">当音频的时长发生变化时触发。</td></tr><tr><td style="text-align:center;">emptied</td><td style="text-align:center;">当音频被清空时触发。</td></tr><tr><td style="text-align:center;">ended</td><td style="text-align:center;">当音频播放结束时触发。</td></tr><tr><td style="text-align:center;">error</td><td style="text-align:center;">当音频加载失败时触发。</td></tr><tr><td style="text-align:center;">pause</td><td style="text-align:center;">当音频暂停时触发。</td></tr><tr><td style="text-align:center;">play</td><td style="text-align:center;">当音频开始播放时触发。</td></tr><tr><td style="text-align:center;">ratechange</td><td style="text-align:center;">当音频的播放速度发生变化时触发。</td></tr><tr><td style="text-align:center;">volumechange</td><td style="text-align:center;">当音频的音量发生变化时触发。</td></tr><tr><td style="text-align:center;">waiting</td><td style="text-align:center;">当音频缓冲时触发。</td></tr></tbody></table><h2 id="bdo素覆盖了当前文本的方向-使文本以不同的方向渲染出来。" tabindex="-1"><code>bdo</code>素覆盖了当前文本的方向，使文本以不同的方向渲染出来。 <a class="header-anchor" href="#bdo素覆盖了当前文本的方向-使文本以不同的方向渲染出来。" aria-label="Permalink to &quot;`bdo`素覆盖了当前文本的方向，使文本以不同的方向渲染出来。&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">dir</td><td style="text-align:center;">设置或返回文本的方向。ltr：指示文本应从左到右绘制。rtl：指示文本应从右到左绘制。</td></tr><tr><td style="text-align:center;">lang</td><td style="text-align:center;">设置或返回文本的语言。</td></tr></tbody></table><h2 id="canvas-元素可被用来通过-javascript-canvas-api-或-webgl-api-绘制图形及图形动画。" tabindex="-1"><code>&lt;canvas&gt;</code>:元素可被用来通过 JavaScript（Canvas API 或 WebGL API）绘制图形及图形动画。 <a class="header-anchor" href="#canvas-元素可被用来通过-javascript-canvas-api-或-webgl-api-绘制图形及图形动画。" aria-label="Permalink to &quot;`&lt;canvas&gt;`:元素可被用来通过 JavaScript（Canvas API 或 WebGL API）绘制图形及图形动画。&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">width</td><td style="text-align:center;">设置或返回画布的宽度。</td></tr><tr><td style="text-align:center;">height</td><td style="text-align:center;">设置或返回画布的高度。</td></tr></tbody></table><h2 id="datalist-元素包含一个或多个-option-元素-这些元素被用于-input-元素的列表。" tabindex="-1"><code>&lt;datalist&gt;</code>: <code>元素包含一个或多个 &lt;option&gt; 元素，这些元素被用于 &lt;input&gt; 元素的列表。</code> <a class="header-anchor" href="#datalist-元素包含一个或多个-option-元素-这些元素被用于-input-元素的列表。" aria-label="Permalink to &quot;`&lt;datalist&gt;`: `元素包含一个或多个 &lt;option&gt; 元素，这些元素被用于 &lt;input&gt; 元素的列表。`&quot;">​</a></h2><h2 id="details-元素包含一个包含内容的可展开-折叠区域。" tabindex="-1"><code>&lt;details&gt;</code>: 元素包含一个包含内容的可展开/折叠区域。 <a class="header-anchor" href="#details-元素包含一个包含内容的可展开-折叠区域。" aria-label="Permalink to &quot;`&lt;details&gt;`: 元素包含一个包含内容的可展开/折叠区域。&quot;">​</a></h2><blockquote><p><code>展现组件通常在屏幕上使用一个小三角形，旋转（或扭转）以表示打开/关闭的状态，三角形旁边有一个标签。&lt;summary&gt; 元素的内容被用来作为展示小部件的标签。</code></p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">事件</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">ontoggle</td><td style="text-align:center;">当 details 元素的 open 属性发生变化时触发。</td></tr></tbody></table><h2 id="iframe-它能够将另一个-html-页面嵌入到当前页面中。" tabindex="-1"><code>&lt;iframe&gt;</code>:它能够将另一个 HTML 页面嵌入到当前页面中。 <a class="header-anchor" href="#iframe-它能够将另一个-html-页面嵌入到当前页面中。" aria-label="Permalink to &quot;`&lt;iframe&gt;`:它能够将另一个 HTML 页面嵌入到当前页面中。&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">height</td><td style="text-align:center;">设置或返回 iframe 的高度。</td></tr><tr><td style="text-align:center;">width</td><td style="text-align:center;">设置或返回 iframe 的宽度。</td></tr><tr><td style="text-align:center;">name</td><td style="text-align:center;">设置或返回 iframe 的名称。</td></tr><tr><td style="text-align:center;">sandbox</td><td style="text-align:center;"><code>控制应用于嵌入在 &lt;iframe&gt; 中的内容的限制。该属性的值可以为空以应用所有限制，也可以为空格分隔的标记以解除特定的限制</code>。</td></tr><tr><td style="text-align:center;">src</td><td style="text-align:center;">被嵌套的页面的 URL 地址。使用 about:blank 值可以嵌入一个遵从同源策略的空白页。</td></tr><tr><td style="text-align:center;">srcdoc</td><td style="text-align:center;">设置或返回 iframe 的 HTML 内容。</td></tr><tr><td style="text-align:center;">title</td><td style="text-align:center;">设置或返回 iframe 的标题。</td></tr><tr><td style="text-align:center;">allow</td><td style="text-align:center;">设置或返回 iframe 的 allow 属性。</td></tr><tr><td style="text-align:center;">allowfullscreen</td><td style="text-align:center;"><code>设置为true时，可以通过调用 &lt;iframe&gt; 的 requestFullscreen() 方法激活全屏模式。</code>。</td></tr><tr><td style="text-align:center;">allowpaymentrequest·</td><td style="text-align:center;"><code>设置为true时，跨域的 &lt;iframe&gt; 就可以调用 Payment Request API。</code>。</td></tr><tr><td style="text-align:center;">allowtransparency</td><td style="text-align:center;">设置为true时，iframe 的背景色透明。。</td></tr><tr><td style="text-align:center;">srcdoc</td><td style="text-align:center;">不支持iframe 渲染此内容 。</td></tr></tbody></table><h2 id="link-外部资源链接" tabindex="-1"><code>&lt;link&gt;</code>:外部资源链接 <a class="header-anchor" href="#link-外部资源链接" aria-label="Permalink to &quot;`&lt;link&gt;`:外部资源链接&quot;">​</a></h2><blockquote><p>元素规定了当前文档与某个外部资源的关系。该元素最常用于链接样式表，此外也可以被用来创建站点图标（比如 PC 端的“favicon”图标和移动设备上用以显示在主屏幕的图标)</p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">as</td><td style="text-align:center;"><code> 指定资源类型。当在 &lt;link&gt; 元素上设置了 rel=&quot;preload&quot; 时，该属性为必填属性；当设置了 rel=&quot;modulepreload&quot;时，该属性为可选属性，否则不应使用。 </code></td></tr><tr><td style="text-align:center;">crossorigin</td><td style="text-align:center;"><code>指定是否允许浏览器跨域请求资源。该枚举属性表示在获取资源时是否必须使用 CORS。启用 CORS 的图像可以在 &lt;canvas&gt; 元素中重复使用，而不会受到污染。anonymous会发起一个跨源请求（即包含 Origin HTTP 标头），但不会发送任何认证信息.use-credentils</code></td></tr><tr><td style="text-align:center;">href</td><td style="text-align:center;">指定要加载的资源。</td></tr><tr><td style="text-align:center;">hreflang</td><td style="text-align:center;">指定资源的语言。</td></tr><tr><td style="text-align:center;">fetchpriority</td><td style="text-align:center;">为获取预加载资源时使用的相对优先级提供提示。允许的值：high 表示相对于其他同类型资源，以高优先级获取。 low 表示相对于其他同类型资源，以低优先级获取。 auto 默认值：表示自动确定相对于其他同类型资源的取值优先级</td></tr><tr><td style="text-align:center;">imagesize</td><td style="text-align:center;">仅适用于 rel=&quot;preload&quot; 和 as=&quot;image&quot;，imagesrcset 属性是一种 sourceset 属性，表示要预载 img 元素使用的适当资源，其 srcset 和 sizes 属性具有相应的值。</td></tr><tr><td style="text-align:center;">media</td><td style="text-align:center;">该属性指定链接资源适用的媒体。其值必须是媒体类型或媒体查询。该属性主要用于链接外部样式表——它允许用户代理选择</td></tr><tr><td style="text-align:center;">rel</td><td style="text-align:center;">此属性命名链接文档与当前文档的关系。该属性必须是链接类型值的用空格分隔的列表。</td></tr><tr><td style="text-align:center;">type</td><td style="text-align:center;">type这个属性被用于定义链接的内容的类型。这个属性的值应该是类似于 text/html、text/css 这样的 MIME 类型。该属性的通常用法是定义被引用的样式表类型（如 text/css），但由于 CSS 是网络上使用的唯一样式表语言，因此不仅可以省略 type 属性，而且现在已成为推荐做法。它还用于 rel=&quot;preload&quot; 链接类型，以确保浏览器只下载其支持的文件类型。</td></tr></tbody></table><h2 id="progress-进度条" tabindex="-1"><code>&lt;progress&gt;</code>:进度条 <a class="header-anchor" href="#progress-进度条" aria-label="Permalink to &quot;`&lt;progress&gt;`:进度条&quot;">​</a></h2><blockquote><p>元素表示一个任务流程的进度，比如下载一个文件。该元素可以显示任务完成百分比，也可以显示任务完成状态。</p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">max</td><td style="text-align:center;">定义进度条的最大值。默认值为 1。</td></tr><tr><td style="text-align:center;">value</td><td style="text-align:center;">定义进度条的当前值。默认值为 0。</td></tr></tbody></table><h2 id="script-脚本" tabindex="-1"><code>&lt;script&gt;</code>:脚本 <a class="header-anchor" href="#script-脚本" aria-label="Permalink to &quot;`&lt;script&gt;`:脚本&quot;">​</a></h2><blockquote><p>元素用于定义客户端脚本，比如 JavaScript。</p></blockquote><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">async</td><td style="text-align:center;">指定脚本是否异步执行。默认情况下，脚本是同步执行的，这意味着浏览器必须等待脚本加载并执行后才会继续加载和渲染页面。使用 async 属性，可以 tell 浏览器加载并执行脚本，而不必等待脚本执行完成。</td></tr><tr><td style="text-align:center;">defer</td><td style="text-align:center;">指定脚本是否在页面加载后立即执行。默认情况下，脚本是同步执行的，这意味着浏览器必须等待脚本加载并执行后才会继续加载和渲染页面。使用 defer 属性，可以 tell 浏览器加载脚本，但不会立即执行脚本。浏览器会在页面加载完成后，再执行脚本。</td></tr><tr><td style="text-align:center;">src</td><td style="text-align:center;">指定脚本文件的 URL。</td></tr><tr><td style="text-align:center;">type</td><td style="text-align:center;">指定脚本文件的类型。默认情况下，浏览器会根据文件扩展名来判断脚本文件的类型。但是，使用 type 属性可以 tell 浏览器加载和执行脚本文件的类型。</td></tr></tbody></table><h1 id="全局属性" tabindex="-1">全局属性 <a class="header-anchor" href="#全局属性" aria-label="Permalink to &quot;全局属性&quot;">​</a></h1><table tabindex="0"><thead><tr><th style="text-align:center;">属性</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">accesskey</td><td style="text-align:center;">指定一个访问键，用于激活或聚焦元素。</td></tr><tr><td style="text-align:center;">autocapitalize</td><td style="text-align:center;">指定是否自动大写输入的字符。off or none: 没有应用自动大写（所有字母都默认为小写字母）。on or sentences: 每个句子的第一个字母默认为大写字母；所有其他字母都默认为小写字母。 words: 每个单词的第一个字母默认为大写字母；所有其他字母都默认为小写字母。 characters: 所有的字母都默认为大写。</td></tr><tr><td style="text-align:center;">autofocus</td><td style="text-align:center;"><code>autofocus 是一个布尔属性，表示元素应在页面加载时或其所属的 &lt;dialog&gt; 显示时被聚焦</code></td></tr><tr><td style="text-align:center;">class</td><td style="text-align:center;">class 的值是一个以空格分隔的元素的类名（classes）列表，它允许 CSS 和 Javascript 通过类选择器</td></tr><tr><td style="text-align:center;">contenteditable</td><td style="text-align:center;">一个枚举属性，表示元素是否可被用户编辑。如果可以，浏览器会修改元素的组件以允许编辑。true 或空字符串，表示元素是可编辑的。false 表示元素不是可编辑的。 plaintext-only 表示元素的原始文本是可编辑的，但富文本格式会被禁用</td></tr><tr><td style="text-align:center;"><code>data-* </code></td><td style="text-align:center;">是一类被称为自定义数据属性的属性，它赋予我们在所有 HTML 元素上嵌入自定义数据属性的能力，并可以通过脚本在 HTML 与 DOM 表现之间进行专有数据的交换。</td></tr><tr><td style="text-align:center;">draggable</td><td style="text-align:center;">draggable 是一种枚举属性，用于标识元素是否允许使用浏览器原生行为或 HTML 拖放操作 API 拖动。</td></tr><tr><td style="text-align:center;">id</td><td style="text-align:center;">定义了一个全文档唯一的标识符（ID）。它用于在链接（使用片段）、脚本和样式（通过 CSS）中辨识元素。</td></tr><tr><td style="text-align:center;">inputmode</td><td style="text-align:center;">是一个枚举属性，它提供了用户在编辑元素或其内容时可能输入的数据类型的提示。它可以是 text、numeric、decimal、search、tel、email、url。</td></tr></tbody></table>',30),n=[d];function i(c,s,o,g,y,x){return l(),e("div",null,n)}const u=t(r,[["render",i]]);export{b as __pageData,u as default};
